    isThemeDialogOpen,
    handleThemeSelect,
    isAuthDialogOpen,
    handleAuthSelect,
    selectedAuthType: settings.merged.security?.auth?.selectedType,
    isEditorDialogOpen,
    exitEditorDialog,
    isSettingsDialogOpen,
    closeSettingsDialog,
