    if (!contentGeneratorConfig) {
      return;
    }

    let models: AvailableModel[] = [];
    if (contentGeneratorConfig.authType === AuthType.USE_OPENAI) {
      const baseUrl = contentGeneratorConfig.baseUrl || process.env['OPENAI_BASE_URL'] || '';
