    const lastUserMessage = userMessages.at(-1);
    let textToSet = lastUserMessage || '';

    // Append queued messages if any exist
    const queuedText = getQueuedMessagesText();
    if (queuedText) {
      textToSet = textToSet ? `${textToSet}\n\n${queuedText}` : queuedText;
